import React from 'react'
import {} from 'react-router-dom'    //Use router
import EmailIcon from '@mui/icons-material/Email';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import PhoneIcon from '@mui/icons-material/Phone';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import './css/Navbar.css';
import { Link } from 'react-router-dom';
const Navbar = () => {
    return (
        <div className="navbar">
            <div className="displayimage">
                <img src="./assets/DivyeGupta.jpeg" alt="" srcset="" />
            </div>
            <div className="pages">
                <Link to = '/'> <h3>Portfolio</h3></Link>
                <Link to = '/projects'> <h3>Projects</h3></Link>
                <Link to = '/contact'> <h3>Contact Me</h3></Link>

                <div className="gap">
                <Link to = '/CV'> <h3>My CV</h3></Link>
                <Link to = '/CV'> <h3>My CV</h3></Link>

                    <h3>My Podcast</h3>
                </div>
            </div>
            <div className="contactlinks">
                <>
                <h5>Get in Touch</h5>
                <a href="mail to: divyegupta00@gmail.com"><EmailIcon/></a>
                <a href="https://github.com/divye-gupta"><GitHubIcon/></a>
                <a href="https://www.linkedin.com/in/divye-gupta-00/"><LinkedInIcon/></a>
                <a href=""><PhoneIcon/></a>
                </>
            </div>
        </div>
    )
}

export default Navbar;
